import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import logo from './logo.svg';

const Layout = () => {
  return (
    <>
      <Link className='logo' to="/">
        <img src={logo} className="App-logo" alt="logo" />
      </Link>
      <main>
        <Outlet />
      </main>
    </>
  );
};

export default Layout;
